query UserViewerEdge($userId: ID!) {
  user(id: $userId) {
    ... on User {
      id
      viewerEdge {
        ...User_viewerEdge
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment User_viewerEdge on UserViewerEdge {
  id
  createdAt
  hasCompletedProfile
  isAllowEdsEnabled
  isBlocking
  isFollowing
  isMuting
  isFacebookFollowing
  isMediumFollowing
  isSuperFollowing
  isTwitterFollowing
  isUser
  lastPostCreatedAt
  readPostsCount
  __typename
}

query ClapCountQuery($postId: ID!) {
  postResult(id: $postId) {
    __typename
    ... on Post {
      id
      clapCount
      __typename
    }
  }
